import { Box, Button, Icon, Link, Path, VStack } from "native-base";
import React from "react";

export default function CustomAccordian({ data }: any) {
  return (
    <Box mt={-3} alignItems="center">
      <VStack space={2} ml={-4}>
        <Link
          fontWeight={400}
          fontFamily="sans-serif"
          fontSize={13}
          isUnderlined={false}
        >
          www.google.com
        </Link>
      </VStack>
    </Box>
  );
}
